import {useEffect, useState} from 'react';

const Profile = () =>{

    const [user, setUser] = useState([]);
   
    const config = {
        headers:{
            Authorization:localStorage.getItem('token')
    }
    
}
    
    
    
    useEffect(() => {
        (
            async() => {
                const response = await fetch("http://localhost:8081/showProfile", config)
            
                const data = await response.json();
                setUser(data);
            }

        )();
     
     }, []);
    
    return (

        <div>
            <table className={'form'}>
                <thead>
                    <tr>
                    <th>ID</th>
                    <br/>
                    <th>NAME</th>
                    <br/>
                    <th>CRM</th>
                    <br/>
                    <th>CPF</th>
                    <br/>
                    </tr>
                </thead>
                <tbody>
                    
                {user.map(
                    (p:Doctor) =>{
                    return(
                    <tr>
                        <th>4354354354</th>
                        <br/>
                        <th>fulaninho</th>
                        <br/>
                        <th>1996</th>
                        <br/>
                        <th>9421313313</th>
                        <br/>
                    </tr>    
                    )
                })}   
                        
                        
                    
                </tbody>
            </table>
        </div>
    );
    }
export default Profile;
